out\";s:4:\"body\";s:150:\"Blocks are boxes of content rendered into an area, or region, of a web page that can be displayed in regions (such as footer or sidebar) on your page.\";s:6:\"weight\";i:1;}s:11:\"place-block\";a:6:{s:2:\"id\";s:11:\"place-block\";s:6:\"plugin\";s:4:\"text\";s:5:\"label\";s:12:\"Place Blocks\";s:4:\"body\";s:163:\"Any custom or contributed block can be added to a particular region by clicking on a button Place block. A new block can also be created by clicking on Place Block\";s:6:\"weight\";i:2;s:10:\"attributes\";a:1:{s:10:\"data-class\";s:13:\"button--small\";}}s:12:\"block-region\";a:6:{s:2:\"id\";s:12:\"block-region\";s:6:\"plugin\";s:4:\"text\";s:5:\"label\";s:12:\"Block Region\";s:4:\"body\";s:150:\"Assign or change the region of a block by clicking here. A dropdown list with all the regions will appear.You can place one block in multiple regions.\";s:6:\"weight\";i:3;s:10:\"attributes\";a:1:{s:10:\"data-class\";s:19:\"block-region-select\";}}s:15:\"configure-block\";a:6:{s:2:\"id\";s:15:\"configure-block\";s:6:\"plugin\";s:4:\"text\";s:5:\"label\";s:15:\"Configure Block\";s:4:\"body\";s:173:\"By Clicking on \"Configure\" you can go ahead and edit the contents of the block, deal with the visibility settings and even change the placement of where it is on your theme.\";s:6:\"weight\";i:4;s:10:\"attributes\";a:1:{s:10:\"data-class\";s:17:\"dropbutton-widget\";}}s:20:\"custom-block-library\";a:5:{s:2:\"id\";s:20:\"custom-block-library\";s:6:\"plugin\";s:4:\"text\";s:5:\"label\";s:20:\"Custom Block Library\";s:4:\"body\";s:203:\"The block management screen also has an another tab on the top which is used to add Custom blocks. The name of the tab is \"Custom block library\". This tab ultimately provides a link to add custom blocks.\";s:6:\"weight\";i:5;}}}',-1,1613910701.927,1,'','0'),('tour.tour.views-ui','a:10:{s:4:\"uuid\";s:36:\"61030c98-6e93-483d-a04b-d265f378b7ac\";s:8:\"langcode\";s:2:\"en\";s:6:\"status\";b:1;s:12:\"dependencies\